        setDepartureD(departure);
    }

    const setIsActive = (active: boolean): void => {
        setIsActi(active);
    }


    const values = {
        selectedProperty,
        arrivalDate,
        departureDate,
        setSelectedPropterty,
        setArrivalDate,
        setDepartureDate,
        isActive,
        setIsActive
    }


    return (        
        <BookingContext.Provider value={values}>
            <MyBooking >
            </MyBooking>
            <PropertyList ></PropertyList>                    
        </BookingContext.Provider>  
    )

}
